        function Random_normal_Dist(mean, sd) {
            data = [];
            min = mean - 4 * sd;
            max = mean + 4 * sd;
            bin = (max - min) / 1000;
            for (var i = 0; i < 1001; i += 1) {
                q = min + i * bin
                p = jStat.normal.pdf(q, mean, sd);
                arr = {
                    "q": q,
                    "p": p
                }
                data.push(arr);
            };
            return data;
        }

        function kernelDensityEstimator(kernel, x) {
            return function (sample) {
                return x.map(function (x) {
                    //console.log(x + " ... " + d3.mean(sample, function(v) { return kernel(x - v); }));
                    return [x, d3.mean(sample, function (v) { return kernel(x - v); })];
                });
            };
        }

        function epanechnikovKernel(bandwith) {
            return function (u) {
                //return Math.abs(u /= bandwith) <= 1 ? .75 * (1 - u * u) / bandwith : 0;
                if (Math.abs(u = u / bandwith) <= 1) {
                    return 0.75 * (1 - u * u) / bandwith;
                } else return 0;
            };
        }

<script>mendeleyWebImporter = {
  downloadPdfs(t,e) { return this._call('downloadPdfs', [t,e]); },
  open() { return this._call('open', []); },
  setLoginToken(t) { return this._call('setLoginToken', [t]); },
  _call(methodName, methodArgs) {
    const id = Math.random();
    window.postMessage({ id, token: '0.11035829490972615', methodName, methodArgs }, 'https://fafdev.ornl.gov');
    return new Promise(resolve => {
      const listener = window.addEventListener('message', event => {
        const data = event.data;
        if (typeof data !== 'object' || !('result' in data) || data.id !== id) return;
        window.removeEventListener('message', listener);
        resolve(data.result);
      });
    });
  }
};</script></body></html>
